type gridPoint struct{ X, Y int }
type gridInt int

func TestGrid(t *testing.T) {
	assert.Equal(t,
		[][]int{{1, 2, 3}, {4, 5, 6}, {7, 8, 9}},
		Grid(Lines, ExtractDigits, "123\n456\n789"),
	)

	assert.Equal(t,
		[][]int64{{10, -2, 300}, {41, 52, 6}, {7654, 8, 0}},
		Grid(Lines, ExtractInt64s, "10 -2 300\n41 52 6\n7654 8 0"),
	)

	assert.Equal(t,
		bigGridActual,
		Grid(Lines, ExtractDigits, bigGridString),
	)
}

func BenchmarkGrid(b *testing.B) {
	for i := 0; i < b.N; i++ {
		Grid(Lines, ExtractDigits, bigGridString)
	}
}

func TestReflectGrid(t *testing.T) {
	assert.Equal(t,
		[][]int8{{1, 2, 3}, {4, 5, 6}, {7, 8, 9}},
		ReflectGrid[int8](Lines, Characters, "123\n456\n789"),
	)

	assert.Equal(t,
		[][]int{{10, -2, 300}, {41, 52, 6}, {7654, 8, 0}},
		ReflectGrid[int](Lines, Whitespace, "10 -2 300\n41 52 6\n7654 8 0"),
	)

	assert.Equal(t,
		bigGridActual,
		ReflectGrid[int](Lines, Characters, bigGridString),
	)

	// test with larger types e.g. struct
	assert.Equal(t,
		[][]gridPoint{
			{{1, 2}, {3, 4}},
			{{5, 6}, {7, 8}},
			{{9, 0}, {0, 9}},
		},
		ReflectGrid[gridPoint](Lines, Characters, "1234\n5678\n9009"),
	)

	// test with aliased integer type
	assert.Equal(t,
		[][]gridInt{{1, 0, 1}, {0, 1, 0}, {1, 0, 1}},
		ReflectGrid[gridInt](Chunks, Lines, "1\n0\n1\n\n0\n1\n0\n\n1\n0\n1"),
	)

	assert.Panics(t, func() {
		ReflectGrid[int8](Lines, Characters, "12 \n456\n789")
	})
}

func BenchmarkReflectGrid(b *testing.B) {
	for i := 0; i < b.N; i++ {
		ReflectGrid[uint8](Lines, Characters, bigGridString)
	}
}
